window.bookSummaryJSON = "<p>There is a plot to kidnap Queen Victoria and only Sherlock Holmes can stop it...or can he?</p> <p>Investigating a crime seemingly unconnected to the Royal Family, Holmes &amp; Watson uncover a conspiracy to kidnap Queen Victoria and destabilise the British Empire.</p> <p>With a ticking clock to her next public engagement, Holmes and Watson must discover who is behind the plot and locate her majesty, while Mycroft tries to keep the monarch’s disappearance a secret from the British people.</p> <p>At first, Holmes believes Moriarty is responsible for the abduction, but when the Napoleon of Crime is proved innocent, Holmes must work with his arch-nemesis to rescue the Queen.</p> <p>An Audible Original drama starring Nicholas Boulton as Sherlock Holmes and Kobna Holdbrook-Smith as Dr. John Watson alongside a full cast.&nbsp;</p> <p>George Mann is a <i>Sunday Times</i> best-selling novelist and scriptwriter. He’s the author of the supernatural crime series Wychwood, as well as the popular Newbury &amp; Hobbes Victorian fantasy series. He’s written several novels featuring a 1920s vigilante known as 'The Ghost', as well as best-selling Doctor Who novels, a Star Wars book and new adventures for Sherlock Holmes. His comic writing includes extensive work on Doctor Who, Dark Souls, Warhammer 40,000, Star Wars as well Teenage Mutant Ninja Turtles for younger listeners and he’s also written audio scripts for Doctor Who, Blake’s 7, Sherlock Holmes and for a handful of high-profile computer games.&nbsp;&nbsp;</p> <p>Cavan Scott has written for such popular franchises as Star Wars, Doctor Who, Star Trek, Vikings, Judge Dredd, Highlander and Warhammer 40,000. Recent comic work includes <i>Star Wars Adventures:</i> <i>Tales From Vader’s Castle </i>and The Real Ghostbusters for IDW, The Incredibles for Dark Horse, Doctor Who and Tekken for Titan, Rogue Trooper for 2000AD and <i>Pacific Rim: Aftermath</i> and <i>Pacific Rim: Amara</i> for Legendary. In 2016, Cavan was chosen as one of the 10 World Book Day authors, his WBD title, <i>Star Wars: Adventures In Wild Space</i> becoming a UK number one best seller. He was also the co-writer of Doctor Who Who-ology, the first Doctor Who book ever to become a <i>Sunday Times</i> best seller.&nbsp;&nbsp;</p> <p>Featuring: Danny Ashock, Rachel Atkins, Nicholas Boulton, Dominic Cazenove, Jessica Dennis, Felicity Duncan, Rupert Farley, Matt Gavan, Raj Ghatak, Don Gilet, Edward Harrison, Kobna Holdbrook-Smith, David Holt, Frances Jeater, Ivanno Jeremiah, Shaheen Khan, Angus King, James MacCallum, Joel MacCormack, Fiz Marcus, Roger May, Amy Mcalister, Gerard McDermott, Paul McEwan, Harry Myers, Greg Page, James Parkes, Jenny Runacre, Mark Straker, Inel Tomlinson and Timothy Watson.</p>"; 
